import React from 'react';
import './Navbar.css'; // Ensure this path matches your setup

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar-container">
        <a href="/" className="navbar-logo">

        Expense Tracker</a>
        <div className="navbar-links">
          <a href="/" className="navbar-link">Home</a>
          <a href="/login" className="navbar-link">Login/Register</a>
          <a href="/about" className="navbar-link">About</a> {/* Add About link */}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
